const ContactList = ({ contacts, filterName, deleteContacts }) => (
  <div>
    <ul>
      {contacts
        .filter((contact) => filterName(contact.name))
        .map((contact, index) => (
          <li>
            {console.log(index)}
            {contact.name}: {contact.number}
            <button onClick={deleteContacts}>delete</button>
          </li>
        ))}
    </ul>
  </div>
);
export default ContactList;
